class Feedback(FeedbackTemplate):
  def __init__(self, **properties):
    # Set Form properties and Data Bindings.
    self.init_components(**properties)
    global happy
    happy = ""

  def submit_button_click(self, **event_args):
    """This method is called when the button is clicked"""
    name = self.name_box.text
    email = self.email_box.text
    body = self.body_area.text
    date = datetime.datetime.now()
    attachments = self.file_loader_1.files
    if body or attachment:
      anvil.server.call('send_feedback', name, date, body, attachments, email, happy)
      alert("Your feedback has been submitted!")
      self.name_box.text = ""
      self.email_box.text = ""
      self.body_area.text = ""
      self.file_loader_1.clear()
      
    else:
      alert("Please fill out before submitting.")

